/* eslint-disable react-hooks/rules-of-hooks */
import React from "react";
import { Grid, Form, Input } from "semantic-ui-react";
import {
  countryOptions,
  jobOptions,
  businessModelOptions,
} from "assets/selectableOptions";
import WithSelect from "components/container/withSelect";
import WithButtonGroup from "components/container/withButtonGroup";

const UserForm: React.FC = () => {
  return (
    <React.Fragment>
      <Form>
        <Grid columns={2} divided="vertically">
          <Grid.Row centered>
            <WithSelect name="Country" options={countryOptions} />
          </Grid.Row>
          <Grid.Row centered>
            <Grid.Column>
              <WithSelect name="BM Type" options={businessModelOptions} />
              <WithSelect name="Job" options={jobOptions} />
            </Grid.Column>
            <Grid.Column>
              <WithButtonGroup left="Quote" right="Deal" />
              <Input type="date" />
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </Form>
    </React.Fragment>
  );
};

export default UserForm;
